import Header from "../components/Header";

import jsonData from'../../public/logements.json';

function Home(){
    return (
        <>
        <Header/>
        <h2>Home page</h2>
        <main className='home-main'>
                <div className="gallery">
                    <ul>
                        {jsonData.map((item) => (
                            <Card
                                key={item.id}
                                id={item.id}
                                cover={item.cover}
                                title={item.title}
                            />
                        ))}
                    </ul>
                </div>
            </main>
        </>
    )
}
export default Home;
